function handleInput(e){var o=jQuery(e.target).get(0);if(o.type=="radio"||o.type=="checkbox"){addToList('tester.checkCheckbox("'+o.name+'", "'+o.value+'");')}else{if(o.type=="text"){addToList('tester.setFormElement("'+o.name+'", "'+o.value+'");')}else{if(o.tagName.toLowerCase()==="textarea"){addToList('tester.setFormElement("'+o.name+'", "'+o.value+'");')}}}return true}function handleSubmit(e){var o=jQuery(e.target).get(0);if(o.type=="submit"){addToList('tester.submit("'+o.name+'");')}return true}function handleSelect(e){var o=e.currentTarget;var label=getSelectedLabel(o)+"";addToList("// Select '"+trim(label)+"' from select box '"+o.name+"'.");addToList('tester.selectOption("'+o.name+'", "'+trim(label)+'");');console.warn("handleselect");return true}function handleAnchor(e){var o=jQuery(e.target).get(0);if(o.id){addToList("// Click Link '"+stripText(o)+"' (id='"+o.id+"').");addToList('tester.clickLink("'+o.id+'");')}else{addToList('tester.clickLinkWithText("'+o.innerHTML+'");')}return true}function handleFormSubmit(e){var o=jQuery(e.target).get(0);if(!o.action){o=o.form}addToList('tester.setWorkingForm("'+o.name+'");');addToList("tester.submit();");return true};